import React, { useState } from 'react';
import './Access.css'; // Asegúrate de que este archivo contenga los nuevos estilos CSS

const Access = () => {
  const [userData, setUserData] = useState({
    email: '',
    password: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUserData({
      ...userData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Lógica para manejar el envío de datos
  };

  return (
    <div className="access-container">
      <form className="form">
        <div className="flex-column">
          <label>Email</label>
        </div>
        <div className="inputForm">
          {/* Icono SVG para Email */}
          {/* Incluye aquí el SVG correspondiente */}
          <input
            type="email"
            className="input"
            placeholder="Enter your Email"
            name="email"
            value={userData.email}
            onChange={handleChange}
          />
        </div>

        <div className="flex-column">
          <label>Password</label>
        </div>
        <div className="inputForm">
          {/* Icono SVG para Password */}
          {/* Incluye aquí el SVG correspondiente */}
          <input
            type="password"
            className="input"
            placeholder="Enter your Password"
            name="password"
            value={userData.password}
            onChange={handleChange}
          />
        </div>

        <div className="flex-row">
          <div>
            <input type="checkbox" />
            <label>Remember me</label>
          </div>
          <span className="span">Forgot password?</span>
        </div>

        <button className="button-submit">Sign In</button>

        <p className="p">
          Don't have an account? <span className="span">Sign Up</span>
        </p>
        <p className="p line">Or With</p>

        <div className="flex-row">
          <button className="btn google">
            {/* Icono SVG para Google */}
            {/* Incluye aquí el SVG correspondiente */}
            Google
          </button>
          <button className="btn apple">
            {/* Icono SVG para Apple */}
            {/* Incluye aquí el SVG correspondiente */}
            Apple
          </button>
        </div>
      </form>
    </div>
  );
};

export default Access;
